import React from 'react'
import './Post.css';
import Avatar from "@material-ui/core/Avatar";

function Post() {
    return (
        <div className="post">
            <div className="post__header">
            <Avatar
                className="post__avatar"
                alt='LBJ'
                src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/LeBron_James_crop.jpg/440px-LeBron_James_crop.jpg"
            />

            <h3>Username</h3>
            </div>

            <img className="post__image" src="https://photographycourse.net/wp-content/uploads/2014/11/Landscape-Photography-steps.jpg" alt="" />

            <h4 className="post__text"><strong>Name</strong> caption</h4>

        </div>
    )
}

export default Post
